import React from 'react'
import PropTypes from 'prop-types'

const HttpTable = ({data}) => {

    const output = data.map( info => (
        <tr className="text-xs pb-8" key={info._id}>
            <th className="px-8 align-top ">{info.status}</th>
            <td className="px-6">{info.response}</td>
        </tr>
    ))

    return (
        <div className="mx-6 border-4 rounded-lg border-gray-200">
            <table className="pb-8" >
                <tbody >
                    {output}
                </tbody>
            </table>

        </div>
    )
}

HttpTable.propTypes = {

}

export default HttpTable
